import { useRouter } from "next/router";
import useSWR from "swr";
import fetcher from "../../lib/fetcher";

const puppeteerScrapeScriptTag = require("./puppeteerScrapeScriptTag.js");

function ArtistInfo(req, res, { info }) {
  res.end(JSON.stringify({ test: "this works" }));
}

export async function getStaticProps() {
  console.log("here");

  // Call an external API endpoint to get posts.
  const info = await puppeteerScrapeScriptTag("5Z3IWpvwOvoaWodujHw7xh");

  // By returning { props: posts }, the Blog component
  // will receive `posts` as a prop at build time
  return {
    props: {
      info
    }
  };
}

export default ArtistInfo;
